var PPUA={init:function(){this.bodyShow(),this.loadNav(),this.loadFoot(),this.headerBG()},loadNav:function(){$("#main-navigation").load("partials/navigation.html")},loadFoot:function(){$("#page-footer").load("partials/footer.html",function(){$('[data-toggle="tooltip"]').tooltip()})},headerBG:function(){var o=$("#main-header").data("bg");$("#main-header").css("background-image","url(assets/images/"+o)},bodyShow:function(){$(window).on("load",function(){$("body#homepage").css("display","block")})}};$(document).ready(function(){PPUA.init()});